text:
islamic state fighters announced plans to lay down their arms tuesday after an ad by the shaving product brand gillette convinced them their efforts to re-establish the caliphate were the result of toxic masculinity. “i never thought twice about decapitating human rights workers, blowing up shiite mosques or keeping young yazidi girls as sex slaves, because i was always told that was just the way guys were supposed to act,” said former caliph abu bakr al-baghdadi, who since quitting jihad has taken up knitting. “but when i saw that gillette ad, i thought, ‘am i really being the best i can be?’” read more @ tmb - https://bit.ly/2mdk9jk

#gillette #toxicmasculinity #isis #comedy #satire #instafunny #metoo #jihad #terror 
@comedycentral @stephenathome @sethrogen @bassemyoussef @trevornoah @smakigram @willsmith

