text:
#sundance #sundancefilmfestival #stopleavingneverlandnow #boycottsundance2019 #notguiltyonallcou #metoo #hetoo #anopensecret #kids2 #truth

@sundance "the police sergeant and the detective wanted to talk to me about michael. records of this conversation have long been in the press, and i made it clear that michael had never touched me and had never acted inappropriately with me. as surprising as it may sound, i admitted on the tape that i was actually molested, and even gave the name of the criminal. sergeant deborah linden, who asked me questions, just shrugged it off. she wasn't interested." from "coreyography", autobiography by corey feldman.

stop listening to robson's stories, listen to the real victims, listen to them. the people they point to are still working with children!

